CREATE DEFINER=`root`@`localhost` FUNCTION `GetPassword`(username VARCHAR(45)) RETURNS varchar(45) CHARSET latin1
BEGIN
	DECLARE pword VARCHAR(15);
	
    SET pword = ( SELECT  password
						FROM    user
						WHERE username = user.usename
						ORDER BY
							user
						LIMIT 1
					);
	
RETURN pword;
END ;;
