CREATE DEFINER=`root`@`localhost` PROCEDURE `Search`(keywords longtext, count int, oset int, 
	s_suburb VARCHAR(35), s_state VARCHAR(45), s_postcode VARCHAR(45), s_monday VARCHAR(45), s_tuesday VARCHAR(45), s_wednesday VARCHAR(45), s_thursday VARCHAR(45), s_friday VARCHAR(45), s_saturday VARCHAR(45), s_sunday VARCHAR(45), 
    s_public_holidays VARCHAR(45), s_make VARCHAR(45), s_model VARCHAR(45), s_body VARCHAR(45), s_doors VARCHAR(45), s_year VARCHAR(45), s_kms VARCHAR(45), s_enginecc VARCHAR(45), s_transmission VARCHAR(45))
BEGIN
	SELECT email, rego, make, model, year, doors, petrol, transmission, enginecc, kms, body, monday, tuesday, wednesday, thursday, friday, saturday, sunday, public_holidays, postcode, suburb, state, description, rate
		,
        
	MATCH (rego, make, model, year, doors, petrol, transmission, enginecc, kms, body, postcode, suburb, state, description)
        
	AGAINST (keywords IN BOOLEAN MODE) AS score FROM car
    WHERE 
    car.suburb = 
		CASE 
			WHEN s_suburb = NULL OR s_suburb = "" THEN car.suburb
            ELSE s_suburb
		END
	AND
    car.state = 
		CASE 
			WHEN s_state = NULL OR s_state = "" THEN car.state
            ELSE s_state
		END
	AND
    car.postcode = 
		CASE 
			WHEN s_postcode = NULL OR s_postcode = "" THEN car.postcode
            ELSE s_postcode
		END
	AND
    car.monday = 
		CASE 
			WHEN s_monday = NULL OR s_monday = "" THEN car.monday
            ELSE s_monday
		END
	AND
    car.tuesday = 
		CASE 
			WHEN s_tuesday = NULL OR s_tuesday = "" THEN car.tuesday
            ELSE s_tuesday
		END
	AND
    car.wednesday = 
		CASE 
			WHEN s_wednesday = NULL OR s_wednesday = "" THEN car.wednesday
            ELSE s_wednesday
		END
	AND
    car.thursday = 
		CASE 
			WHEN s_thursday = NULL OR s_thursday = "" THEN car.thursday
            ELSE s_thursday
		END
	AND
    car.friday = 
		CASE 
			WHEN s_friday = NULL OR s_friday = "" THEN car.friday
            ELSE s_friday
		END
	AND
    car.saturday = 
		CASE 
			WHEN s_saturday = NULL OR s_saturday = "" THEN car.saturday
            ELSE s_saturday
		END
	AND
    car.sunday = 
		CASE 
			WHEN s_sunday = NULL OR s_sunday = "" THEN car.sunday
            ELSE s_sunday
		END
	AND
    car.public_holidays = 
		CASE 
			WHEN s_public_holidays = NULL OR s_public_holidays = "" THEN car.public_holidays
            ELSE s_public_holidays
		END
	AND
    car.make = 
		CASE 
			WHEN s_make = NULL OR s_make = "" THEN car.make
            ELSE s_make
		END
	AND
    car.model = 
		CASE 
			WHEN s_model = NULL OR s_model = "" THEN car.model
            ELSE s_model
		END
	AND
    car.body = 
		CASE 
			WHEN s_body = NULL OR s_body = "" THEN car.body
            ELSE s_body
		END
	AND
    car.doors = 
		CASE 
			WHEN s_doors = NULL OR s_doors = "" THEN car.doors
            ELSE s_doors
		END
	AND
    car.year = 
		CASE 
			WHEN s_year = NULL OR s_year = "" THEN car.year
            ELSE s_year
		END
	AND
    car.kms = 
		CASE 
			WHEN s_kms = NULL OR s_kms = "" THEN car.kms
            ELSE s_kms
		END
	AND
    
    car.enginecc = 
		CASE 
			WHEN s_enginecc = NULL OR s_enginecc = "" THEN car.enginecc
            ELSE s_enginecc
		END
	AND

    car.transmission = 
		CASE 
			WHEN s_transmission = NULL OR s_transmission = "" THEN car.transmission
            ELSE s_transmission
		END
    
    ORDER BY score DESC LIMIT count OFFSET oset;
    
    #SELECT id, title, body, MATCH (title,body)  AGAINST ('database' IN BOOLEAN MODE)
	#AS score FROM articles ORDER BY score DESC;
END ;;
